　ベビーカーの底から背面にかけて取り付け。路面からの照り返しの暑さによるお子様への負担をやわらげます！<br>特殊形状のベビーカーには使用できない場合があります。（三輪タイプ・二人乗りタイプ等）<br><br>■サイズ：約30×80ｃｍ（ベルトを除く）<br>■備考：<br>素材・材質：【表生地】アルミ蒸着フィルム、【裏生地】ポリエステル100％<br>【シンセーインターナショナル】<!--関連商品--><br><div class=reltitle> </div><div class=relink><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/45713039502.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル ベビーエプロン </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950232.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル ミルクストック </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950256.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル ボトルスタンド </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950447.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル ジュニアシート　Ｍ型　グリーン </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950829.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル リラックマ　ジュニアシート </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950867.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル mite mite マルチクッション　ミー </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950874.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル mite mite ネッククッション　ミー </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950881.jpg?_ex=80x80 border=0><div class=rel_name>シンセーインターナショナル mite mite ベルトカバー2Ｐ　ミー </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image7/4571303950904.jpg?_ex=80x80 border=0><div class=rel_name